★ホーズのレトロランニングスニーカー！<br>
<br>
●アッパーはメッシュとスウェードを使用し、通気性の確保とデザイン性を両立。<br>
●インソールは取り外しのできるカップ式クッションインソール！<br>
●ソールは2層のスポンジラバーとEVAを組み合わせたクッショニング仕様で履き心地抜群！<br>
●つま先のガード部分にはカービングを設け屈曲性能を向上。<br>
<br>
■素材<br>
アッパー：合成皮革、テリレン<br>
インナー：合成皮革<br>
アウトソール：EVA、ラバースポンジ<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■サイズ 26.0～28.0cm<br>
<br>
《当店スタッフの着用感コメント》<br>
こちらのシューズのワイズ幅はやや細めとなっております。<br>
・きっちり、ジャストフィット感をお求めの場合は0.5cmアップをおススメ致します。<br>
・幅広甲高の方、ゆったりとした履き心地をお求めの場合は1.0cmアップ<br>
をお選び頂ければ良いかと思われます。<br>
※サイズ選びは足型や履き心地等に個人差がございますのであくまで目安としてお考えください。
