5月31日現在は、花は咲いておりません。<br>これから育てていきたいと思っている方向き<BR>花を咲くのを育てて楽しんでください。<BR><BR>

誰からも「いい香り！」と好まれるにおいばんまつり。お部屋に1鉢あるだけで、部屋中がジャスミンの香りで包まれます。<BR>
<BR>
咲き始めは紫色で、日が経つにつれて白色に変化していきます。次々と咲いてくれるので、1本の木でたくさんの花色を楽しむことができます♪<BR>
<BR>
<BR>
（高さ約50cm×横40cm）<BR>6号鉢
<BR>
　開花期：4～7月<BR>
<BR>
5月31日現在花は咲いておりません。ギフトには不向きです。
※多少葉・花付きがお写真と異なる場合がございます。<BR><img src="https://image.rakuten.co.jp/la-floraison/cabinet/mother2016/father2016/imgrc0070864958.jpg"  alt="父の日"><BR>


